import { Image } from "@gluestack-ui/themed";
import React from "react";

const BackGround_blue = () => {
    return <Image w={"100%"} h={"100%"} source={
        require("../assets/Icons/fondo.png")
    } alt="bg" />
};
export default BackGround_blue;
